package flowcontrols;

public class pattern9 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int count=0;
		for (int i=1;i<6;i++)
		{
			for(int j=1;j<6;j++)
				
			{
				System.out.print(count +"\t");
				count=count+2;
			}
			System.out.println();
	}
	}
}
